INSERT INTO `app_news` VALUES (2, 12, '超级管理员', '2024-05-09 09:09:29', 12, '超级管理员', '2024-05-09 09:09:29', '“变成蝴蝶参加我婚礼！”湖南一新郎给已逝外婆发信息，婚礼上一幕全网泪目', '婚礼上，新郎正念着誓词，发现身旁一直有只蝴蝶在飞。新郎向现场嘉宾解释，今年年初外婆病逝，婚礼前，曾给外婆发消息称，“如果你想来参加我们的婚礼，你可以变成一只蝴蝶飞到我的肩膀上吗？”解释完后，蝴蝶恰好落在了新郎胸前，新郎终于控制不住自己的情绪，放声大哭。\n这巧合的一幕，被现场宾客记录下发布到网上，有网友表示，“如果有一些事无法用科学解释，那就交给爱。”\n5月8日，潇湘晨报记者与新郎王展取得联系，王展告诉记者，婚礼是5月2日在老家岳阳湘阴举办，外婆去世前最大的遗憾便是不能参加王展的婚礼，“我觉得外婆没有来参加婚礼是一个遗憾，但是她变成蝴蝶来参加我的婚礼，又满足了我的愿望，对于我来说，我没什么遗憾了。”视频走红后，王展也曾在自己的社交账号上回复此事，“也是想通过自己的故事告诉大家，要学会去爱自己的亲人，珍惜当下。”', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_eaf28f116e3c449bb3f1a79f7f9dfb74.png', '娱乐', 0, '潇湘晨报');
INSERT INTO `app_news` VALUES (3, 12, '超级管理员', '2024-05-09 09:11:20', 12, '超级管理员', '2024-05-09 09:11:20', '庚欣：中国元首访欧，如何为地区注入正能量？', '特约评论员 庚欣：我认为这次习近平主席访问法国，表现了中法关系有一个重大的进展，甚至可以说是双边关系正呈现一种“升级”的态势，发表的4项联合声明和达成的18项合作协议是成果的集中体现。其中，我特别关注双方达成的“中法关于中东局势的联合声明”和“中法关于人工智能和全球治理的联合声明”，传递了很多新的重要外交信息。\n\n还表现了比具体的中东或人工智能等具体问题更深刻、更广泛的重大原则意义和价值，可以概括为“四大价值”：\n\n一是“大国带头”，就是说在重要的国际变局和动荡之际，主要大国应该负责任地带头发挥正面的引领作用，积极作为，创新务实地来弥补国际治理的“赤字”。', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_80ac13a16d3141d1980633541568521a.png', '军事', 0, '直新闻 ');
INSERT INTO `app_news` VALUES (4, 12, '超级管理员', '2024-05-09 09:12:49', 12, '超级管理员', '2024-05-09 09:12:49', '宋仲基宋慧乔将同框出席百想，离婚5年后，他们实现首度同台', '2024韩国百想艺术大赏入围名单已经公布，目前获得的最新动态消息：宋仲基宋慧乔将共同出席该盛典！\n第60届百想艺术大赏，5月7日的下午将在韩国的江南COEX举行。\n值得大家期待的就是已经确定：宋慧乔、宋仲基将双双出席百想！！！\n没错，这是他们时隔5年之后的首度公开同框，共同参加百想艺术大赏。', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_3061ff15e7de41b8a6edabc9cf45ec5f.png', '娱乐', 0, '素素娱乐');
INSERT INTO `app_news` VALUES (5, 12, '超级管理员', '2024-05-09 09:13:49', 12, '超级管理员', '2024-05-09 09:13:49', '欧冠狂欢夜！替补奇兵双响，皇马逆转拜仁，第18次晋级决赛创历史', '北京时间5月9日凌晨，欧冠半决赛次回合第二场开打，由皇家马德里主场对阵拜仁慕尼黑。上半场，维尼修斯击中立柱，门将诺伊尔神勇发挥，帮助拜仁力保球门不失。到了下半场，比赛风云突变，阿方索-戴维斯打破僵局，何塞卢替补梅开二度，帮助皇马2-1逆转绝杀，最终总比分4-3晋级决赛。', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_131c84bf4f984016b28fae154f7d66c4.png', '体育', 0, '侃球熊弟');
INSERT INTO `app_news` VALUES (6, 12, '超级管理员', '2024-05-09 09:14:42', 12, '超级管理员', '2024-05-09 09:14:42', '拜仁众将怒斥绝平球被吹：耻辱！皇马欧冠屡受照顾，安帅霸气回击', '在北京时间5月9日凌晨结束的欧冠半决赛次回合第2场对决中，拜仁在客场一度率先进球的情况下，1-2被皇马逆转，总比分3-4被淘汰，无缘晋级决赛。而在比赛最后时刻，拜仁曾打进一球，但却被吹越位在先进球无效。\n当时比赛已经到了读秒阶段，拜仁长传球吊入皇马禁区内，德里赫特接到穆勒头球摆渡后，扫射破门，但边裁却未等这次进攻完成，便早早举旗，判罚马兹拉维越位在先。而最终皇马球员几乎都已经放弃防守，门将卢宁也没有做出任何扑救。\n\n', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_1419993610b54c65b5fca4096f8bf503.png', '体育', 0, '我爱英超');
INSERT INTO `app_news` VALUES (7, 12, '超级管理员', '2024-05-09 09:15:24', 12, '超级管理员', '2024-05-09 09:15:24', '欧冠刺激3分钟：拜仁轰世界波！皇马进球被吹，7万人空欢喜', '欧冠半决赛次回合，皇马主场迎战拜仁。第68分钟，阿方索-戴维斯世界波攻破皇马大门，第71分钟，皇马的进球被吹。这短短3分钟，皇马球迷经历悲喜两重天……不过最后时刻，何塞卢连进2球，帮助皇马2-1逆转！\n首回合的对决，两队打成2-2平。这是第28次欧洲德比，前27次交锋，皇马12胜，拜仁11胜。伯纳乌球场座无虚席，7.6万观众到场。', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_09994a50a1f7453aa106e898c4308b2f.png', '体育', 0, '叶青足球世界');
INSERT INTO `app_news` VALUES (8, 12, '超级管理员', '2024-05-09 09:17:01', 156, '管理员', '2024-05-09 11:45:47', '《浪姐5》让女星“原形毕露”：有的口是心非，有的只顾自己', '《浪姐5》第一次公演落下帷幕，韩懿莹和李溪芮遗憾淘汰出局。\n\n两人临走前姐姐们也是以泪相送，场面让观众心里不是滋味。\n\n但选秀节目向来如此，有人欢喜有人忧，“小透明”选手只有被淘汰的份。\n而且这一季的炮灰姐姐们不在少数，网传二公结束后又有四位姐姐离开舞台。\n\n其中Yamy郭颖让人感到可惜，毕竟她也是专业爱豆，只不过人气一直不温不火，在节目里也没有太多综艺感和存在感，这个结果倒是在意料之中。\n《浪姐5》第一次公演落下帷幕，韩懿莹和李溪芮遗憾淘汰出局。\n\n两人临走前姐姐们也是以泪相送，场面让观众心里不是滋味。\n\n但选秀节目向来如此，有人欢喜有人忧，“小透明”选手只有被淘汰的份。\n而且这一季的炮灰姐姐们不在少数，网传二公结束后又有四位姐姐离开舞台。\n\n其中Yamy郭颖让人感到可惜，毕竟她也是专业爱豆，只不过人气一直不温不火，在节目里也没有太多综艺感和存在感，这个结果倒是在意料之中。\n《浪姐5》第一次公演落下帷幕，韩懿莹和李溪芮遗憾淘汰出局。\n\n两人临走前姐姐们也是以泪相送，场面让观众心里不是滋味。\n\n但选秀节目向来如此，有人欢喜有人忧，“小透明”选手只有被淘汰的份。\n而且这一季的炮灰姐姐们不', 'https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_dc169782f9ec45429f243f507218d027.png', '娱乐', 0, '娱乐圈笔娱君');

