INSERT INTO `easy_oper_log` VALUES (19, '查询【新闻信息表】数据（分页）', 4, 'cn.wujiangbo.controller.app.AppNewsController.pagelist()', 'POST', 1, 12, '/appNews/pagelist', '127.0.0.1', '内网IP', '{\"current\":1,\"size\":10}', '{\"code\":\"0000\",\"data\":{\"rows\":[{\"createTime\":\"2024-05-09T09:17:01\",\"createUserId\":12,\"createUserName\":\"超级管理员\",\"id\":8,\"newAuthor\":\"娱乐圈笔娱君\",\"newContent\":\"《浪姐5》第一次公演落下帷幕，韩懿莹和李溪芮遗憾淘汰出局。\\n\\n两人临走前姐姐们也是以泪相送，场面让观众心里不是滋味。\\n\\n但选秀节目向来如此，有人欢喜有人忧，“小透明”选手只有被淘汰的份。\\n而且这一季的炮灰姐姐们不在少数，网传二公结束后又有四位姐姐离开舞台。\\n\\n其中Yamy郭颖让人感到可惜，毕竟她也是专业爱豆，只不过人气一直不温不火，在节目里也没有太多综艺感和存在感，这个结果倒是在意料之中。\\n《浪姐5》第一次公演落下帷幕，韩懿莹和李溪芮遗憾淘汰出局。\\n\\n两人临走前姐姐们也是以泪相送，场面让观众心里不是滋味。\\n\\n但选秀节目向来如此，有人欢喜有人忧，“小透明”选手只有被淘汰的份。\\n而且这一季的炮灰姐姐们不在少数，网传二公结束后又有四位姐姐离开舞台。\\n\\n其中Yamy郭颖让人感到可惜，毕竟她也是专业爱豆，只不过人气一直不温不火，在节目里也没有太多综艺感和存在感，这个结果倒是在意料之中。\\n《浪姐5》第一次公演落下帷幕，韩懿莹和李溪芮遗憾淘汰出局。\\n\\n两人临走前姐姐们也是以泪相送，场面让观众心里不是滋味。\\n\\n但选秀节目向来如此，有人欢喜有人忧，“小透明”选手只有被淘汰的份。\\n而且这一季的炮灰姐姐们不\",\"newImg\":\"https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_dc169782f9ec45429f243f507218d027.png\",\"newReadCount\":0,\"newTitle\":\"《浪姐5》让女星“原形毕露”：有的口是心非，有的只顾自己\",\"newType\":\"娱乐\",\"updateTime\":\"2024-05-09T11:45:47\",\"updateUserId\":156,\"updateUserName\":\"管理员\"},{\"createTime\":\"2024-05-09T09:15:24\",\"createUserId\":12,\"createUserName\":\"超级管理员\",\"id\":7,\"newAuthor\":\"叶青足球世界\",\"newContent\":\"欧冠半决赛次回合，皇马主场迎战拜仁。第68分钟，阿方索-戴维斯世界波攻破皇马大门，第71分钟，皇马的进球被吹。这短短3分钟，皇马球迷经历悲喜两重天……不过最后时刻，何塞卢连进2球，帮助皇马2-1逆转！\\n首回合的对决，两队打成2-2平。这是第28次欧洲德比，前27次交锋，皇马12胜，拜仁11胜。伯纳乌球场座无虚席，7.6万观众到场。\",\"newImg\":\"https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_09994a50a1f7453aa106e898c4308b2f.png\",\"newReadCount\":0,\"newTitle\":\"欧冠刺激3分钟：拜仁轰世界波！皇马进球被吹，7万人空欢喜\",\"newType\":\"体育\",\"updateTime\":\"2024-05-09T09:15:24\",\"updateUserId\":12,\"updateUserName\":\"超级管理员\"},{\"createTime\":\"2024-05-09T09:14:42\",\"createUserId\":12,\"createUserName\":\"超级管理员\",\"id\":6,\"newAuthor\":\"我爱英超\",\"newContent\":\"在北京时间5月9日凌晨结束的欧冠半决赛次回合第2场对决中，拜仁在客场一度率先进球的情况下，1-2被皇马逆转，总比分3-4被淘汰，无缘晋级决赛。而在比赛最后时刻，拜仁曾打进一球，但却被吹越位在先进球无效。\\n当时比赛已经到了读秒阶段，拜仁长传球吊入皇马禁区内，德里赫特接到穆勒头球摆渡后，扫射破门，但边裁却未等这次进攻完成，便早早举旗，判罚马兹拉维越位在先。而最终皇马球员几乎都已经放弃防守，门将卢宁也没有做出任何扑救。\\n\\n\",\"newImg\":\"https://easyjava.oss-cn-chengdu.aliyuncs.com/easyjava/HarmonyOSAppTest/20240509_1419993610b54c65b5fca4096f8bf503.png\",\"newReadCoun', 0, NULL, '2024-05-31 17:23:03', 21);
