-- ----------------------------
-- Table structure for easy_system_msg
-- ----------------------------
DROP TABLE IF EXISTS `easy_system_msg`;
CREATE TABLE `easy_system_msg`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '消息创建时间',
  `publish_empno` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息发布者工号',
  `publish_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息发布者名称',
  `msg_title` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息标题',
  `msg_content` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息内容',
  `msg_level` int(1) NULL DEFAULT NULL COMMENT '消息级别（1：非常紧急；2：紧急；3：一般）',
  `receive_user_id` bigint(20) NULL DEFAULT NULL COMMENT '接收人ID（关联easy_user表主键）',
  `receive_user_name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '接收人名称',
  `msg_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '1' COMMENT '消息状态（0：已读；1：未读）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '系统公告表' ROW_FORMAT = COMPACT;

